import React from 'react';
import PatientItem from './PatientItem';
import classes from './PatientItem.module.css'

function PatientsList(props) {
    const filteredPatients = props.patients
        ? props.patients.filter((patient) => {
            const patientName = patient.name ? patient.name.toLowerCase() : '';
            const visitReason = patient.lastVisitReason ? patient.lastVisitReason.toLowerCase() : '';
            return patientName.includes(props.searchTerm.toLowerCase()) || visitReason.includes(props.searchTerm.toLowerCase());
        })
        : [];

    return (
        <ul>
            {filteredPatients.map((patient, index) => (
                <PatientItem
                    key={index}
                    name={patient.name || ''}
                    age={patient.age || ''}
                    lastVisitReason={patient.lastVisitReason || ''}
                />
            ))}
        </ul>
    );
}

export default PatientsList;
